import { styled } from "styled-components";
import { CORAL_PINK } from "../../constants/colors";

const HeaderContainer = styled.div`
    background-color: ${CORAL_PINK};

    ${desktop} {
    margin: 0 10rem;
  }
`;

const TitleText = styled.h1`
    color: white;
`;

export const Header = ({ title }) => (
    <HeaderContainer>
        <TitleText>
            {title}
        </TitleText>
    </HeaderContainer>
);
